import React from "react";
import "./Dai_ly.css";

function Dai_ly() {
    return (
        <div className="Dai_ly">
            <div className="container-fluid">
                <div className="row">
                    <div className="col-md-12">
                        <h1>
                            Vị trí đại lý
                        </h1>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default Dai_ly;
